file:"lib/addons/p5.sound.js",line:11703,description:'\x3cp\x3ep5.sound extends p5 with \x3ca href\x3d"http://caniuse.com/audio-api"\ntarget\x3d"_blank"\x3eWeb Audio\x3c/a\x3e functionality including audio input,\nplayback, analysis and synthesis.\n\x3c/p\x3e\n\x3cul\x3e\n\x3cli\x3e\x3ca href\x3d"#/p5.SoundFile"\x3e\x3cb\x3ep5.SoundFile\x3c/b\x3e\x3c/a\x3e: Load and play sound files.\x3c/li\x3e\n\x3cli\x3e\x3ca href\x3d"#/p5.Amplitude"\x3e\x3cb\x3ep5.Amplitude\x3c/b\x3e\x3c/a\x3e: Get the current volume of a sound.\x3c/li\x3e\n\x3cli\x3e\x3ca href\x3d"#/p5.AudioIn"\x3e\x3cb\x3ep5.AudioIn\x3c/b\x3e\x3c/a\x3e: Get sound from an input source, typically\n  a computer microphone.\x3c/li\x3e\n\x3cli\x3e\x3ca href\x3d"#/p5.FFT"\x3e\x3cb\x3ep5.FFT\x3c/b\x3e\x3c/a\x3e: Analyze the frequency of sound. Returns\n  results from the frequency spectrum or time domain (waveform).\x3c/li\x3e\n\x3cli\x3e\x3ca href\x3d"#/p5.Oscillator"\x3e\x3cb\x3ep5.Oscillator\x3c/b\x3e\x3c/a\x3e: Generate Sine,\n  Triangle, Square and Sawtooth waveforms. Base class of\n  \x3cli\x3e\x3ca href\x3d"#/p5.Noise"\x3ep5.Noise\x3c/a\x3e and \x3ca href\x3d"#/p5.Pulse"\x3ep5.Pulse\x3c/a\x3e.\n  \x3c/li\x3e\n\x3cli\x3e\n  \x3ca href\x3d"#/p5.MonoSynth"\x3ep5.MonoSynth\x3c/a\x3e and \x3ca href\x3d"#/p5.PolySynth"\x3ep5.PolySynth\x3c/a\x3e: Play musical notes\n\x3c/li\x3e\n\x3cli\x3e\x3ca href\x3d"#/p5.Envelope"\x3e\x3cb\x3ep5.Envelope\x3c/b\x3e\x3c/a\x3e: An Envelope is a series\n  of fades over time. Often used to control an object\'s\n  output gain level as an "ADSR Envelope" (Attack, Decay,\n  Sustain, Release). Can also modulate other parameters.\x3c/li\x3e\n\x3cli\x3e\x3ca href\x3d"#/p5.Delay"\x3e\x3cb\x3ep5.Delay\x3c/b\x3e\x3c/a\x3e: A delay effect with\n  parameters for feedback, delayTime, and lowpass filter.\x3c/li\x3e\n\x3cli\x3e\x3ca href\x3d"#/p5.Filter"\x3e\x3cb\x3ep5.Filter\x3c/b\x3e\x3c/a\x3e: Filter the frequency range of a\n  sound.\n\x3c/li\x3e\n\x3cli\x3e\x3ca href\x3d"#/p5.Reverb"\x3e\x3cb\x3ep5.Reverb\x3c/b\x3e\x3c/a\x3e: Add reverb to a sound by specifying\n  duration and decay. \x3c/li\x3e\n\x3cb\x3e\x3cli\x3e\x3ca href\x3d"#/p5.Convolver"\x3ep5.Convolver\x3c/a\x3e:\x3c/b\x3e Extends\n\x3ca href\x3d"#/p5.Reverb"\x3ep5.Reverb\x3c/a\x3e to simulate the sound of real\n  physical spaces through convolution.\x3c/li\x3e\n\x3cb\x3e\x3cli\x3e\x3ca href\x3d"#/p5.SoundRecorder"\x3ep5.SoundRecorder\x3c/a\x3e\x3c/b\x3e: Record sound for playback\n  / save the .wav file.\n\x3cb\x3e\x3cli\x3e\x3ca href\x3d"#/p5.SoundLoop"\x3ep5.SoundLoop\x3c/a\x3e, \x3ca href\x3d"#/p5.Phrase"\x3ep5.Phrase\x3c/a\x3e\x3c/b\x3e, \x3cb\x3e\x3ca href\x3d"#/p5.Part"\x3ep5.Part\x3c/a\x3e\x3c/b\x3e and\n\x3cb\x3e\x3ca href\x3d"#/p5.Score"\x3ep5.Score\x3c/a\x3e\x3c/b\x3e: Compose musical sequences.\n\x3c/li\x3e\n\x3cli\x3e\x3ca href\x3d"#/p5/userStartAudio"\x3euserStartAudio\x3c/a\x3e: Enable audio in a\nbrowser- and user-friendly way.\x3c/a\x3e\n\x3cp\x3ep5.sound is on \x3ca href\x3d"https://github.com/therewasaguy/p5.sound/"\x3eGitHub\x3c/a\x3e.\nDownload the latest version\n\x3ca href\x3d"https://github.com/therewasaguy/p5.sound/blob/master/lib/p5.sound.js"\x3ehere\x3c/a\x3e.\x3c/p\x3e',
