params:[{name:"color",description:'\x3cp\x3e\x3ca href\x3d"#/p5.Color"\x3ep5.Color\x3c/a\x3e object, color components,\n                                        or CSS color\x3c/p\x3e\n',type:"p5.Color|Number[]|String"}],return:{description:"the alpha value",type:"Number"},example:["\n\x3cdiv\x3e\n\x3ccode\x3e\nnoStroke();\nlet c \x3d color(0, 126, 255, 102);\nfill(c);\nrect(15, 15, 35, 70);\nlet value \x3d alpha(c); // Sets 'value' to 102\nfill(value);\nrect(50, 15, 35, 70);\n\x3c/code\x3e\n\x3c/div\x3e"],
