itemtype:"method",name:"volume",return:{description:"current volume",type:"Number"},example:["\n\x3cdiv\x3e\x3ccode\x3e\nlet ele;\nfunction setup() {\n  // p5.MediaElement objects are usually created\n  // by calling the createAudio(), createVideo(),\n  // and createCapture() functions.\n  // In this example we create\n  // a new p5.MediaElement via createAudio().\n  ele \x3d createAudio('assets/lucky_dragons.mp3');\n  background(250);\n  textAlign(CENTER);\n  text('Click to Play!', width / 2, height / 2);\n}\nfunction mouseClicked() {\n  // Here we call the volume() function\n  // on the sound element to set its volume\n  // Volume must be between 0.0 and 1.0\n  ele.volume(0.2);\n  ele.play();\n  background(200);\n  text('You clicked Play!', width / 2, height / 2);\n}\n\x3c/code\x3e\x3c/div\x3e\n\x3cdiv\x3e\x3ccode\x3e\nlet audio;\nlet counter \x3d 0;\n\nfunction loaded() {\n  audio.play();\n}\n\nfunction setup() {\n  audio \x3d createAudio('assets/lucky_dragons.mp3', loaded);\n  textAlign(CENTER);\n}\n\nfunction draw() {\n  if (counter \x3d\x3d\x3d 0) {\n    background(0, 255, 0);\n    text('volume(0.9)', width / 2, height / 2);\n  } else if (counter \x3d\x3d\x3d 1) {\n    background(255, 255, 0);\n    text('volume(0.5)', width / 2, height / 2);\n  } else if (counter \x3d\x3d\x3d 2) {\n    background(255, 0, 0);\n    text('volume(0.1)', width / 2, height / 2);\n  }\n}\n\nfunction mousePressed() {\n  counter++;\n  if (counter \x3d\x3d\x3d 0) {\n    audio.volume(0.9);\n  } else if (counter \x3d\x3d\x3d 1) {\n    audio.volume(0.5);\n  } else if (counter \x3d\x3d\x3d 2) {\n    audio.volume(0.1);\n  } else {\n    counter \x3d 0;\n    audio.volume(0.9);\n  }\n}\n\x3c/code\x3e\n\x3c/div\x3e"],
