line:201,description:'\x3cp\x3eThe system variable rotationZ always contains the rotation of the\ndevice along the z axis. If the sketch \x3ca href\x3d"#/p5/angleMode"\x3e\nangleMode()\x3c/a\x3e is set to DEGREES, the value will be 0 to 360. If\nit is set to RADIANS, the value will be 0 to 2*PI.\n\x3cbr\x3e\x3cbr\x3e\nUnlike rotationX and rotationY, this variable is available for devices\nwith a built-in compass only.\n\x3cbr\x3e\x3cbr\x3e\nNote: The order the rotations are called is important, ie. if used\ntogether, it must be called in the order Z-X-Y or there might be\nunexpected behaviour.\x3c/p\x3e\n',
