line:239,description:'\x3cp\x3eThe system variable pRotationX always contains the rotation of the\ndevice along the x axis in the frame previous to the current frame.\nIf the sketch \x3ca href\x3d"#/p5/angleMode"\x3e angleMode()\x3c/a\x3e is set to DEGREES,\nthe value will be -180 to 180. If it is set to RADIANS, the value will\nbe -PI to PI.\n\x3cbr\x3e\x3cbr\x3e\npRotationX can also be used with rotationX to determine the rotate\ndirection of the device along the X-axis.\x3c/p\x3e\n',example:["\n\x3cdiv class\x3d'norender'\x3e\n\x3ccode\x3e\n// A simple if statement looking at whether\n// rotationX - pRotationX \x3c 0 is true or not will be\n// sufficient for determining the rotate direction\n// in most cases.\n\n// Some extra logic is needed to account for cases where\n// the angles wrap around.\nlet rotateDirection \x3d 'clockwise';\n\n// Simple range conversion to make things simpler.\n// This is not absolutely necessary but the logic\n// will be different in that case.\n\nlet rX \x3d rotationX + 180;\nlet pRX \x3d pRotationX + 180;\n\nif ((rX - pRX \x3e 0 \x26\x26 rX - pRX \x3c 270) || rX - pRX \x3c -270) {\n  rotateDirection \x3d 'clockwise';\n} else if (rX - pRX \x3c 0 || rX - pRX \x3e 270) {\n  rotateDirection \x3d 'counter-clockwise';\n}\n\nprint(rotateDirection);\n\x3c/code\x3e\n\x3c/div\x3e"],
