itemtype:"method",name:"keyTyped",example:["\n\x3cdiv\x3e\n\x3ccode\x3e\nlet value \x3d 0;\nfunction draw() {\n  fill(value);\n  rect(25, 25, 50, 50);\n}\nfunction keyTyped() {\n  if (key \x3d\x3d\x3d 'a') {\n    value \x3d 255;\n  } else if (key \x3d\x3d\x3d 'b') {\n    value \x3d 0;\n  }\n  // uncomment to prevent any default behavior\n  // return false;\n}\n\x3c/code\x3e\n\x3c/div\x3e"],alt:"black rect center. turns white when 'a' key typed and black when 'b' pressed",class:"p5",module:"Events",
