itemtype:"method",name:"httpGet",return:{description:"A promise that resolves with the data when the operation\n                  completes successfully or rejects with the error after\n                  one occurs.",type:"Promise"},example:["\n\x3cdiv class\x3d'norender'\x3e\x3ccode\x3e\n// Examples use USGS Earthquake API:\n//   https://earthquake.usgs.gov/fdsnws/event/1/#methods\nlet earthquakes;\nfunction preload() {\n  // Get the most recent earthquake in the database\n  let url \x3d\n   'https://earthquake.usgs.gov/fdsnws/event/1/query?' +\n    'format\x3dgeojson\x26limit\x3d1\x26orderby\x3dtime';\n  httpGet(url, 'jsonp', false, function(response) {\n    // when the HTTP request completes, populate the variable that holds the\n    // earthquake data used in the visualization.\n    earthquakes \x3d response;\n  });\n}\n\nfunction draw() {\n  if (!earthquakes) {\n    // Wait until the earthquake data has loaded before drawing.\n    return;\n  }\n  background(200);\n  // Get the magnitude and name of the earthquake out of the loaded JSON\n  let earthquakeMag \x3d earthquakes.features[0].properties.mag;\n  let earthquakeName \x3d earthquakes.features[0].properties.place;\n  ellipse(width / 2, height / 2, earthquakeMag * 10, earthquakeMag * 10);\n  textAlign(CENTER);\n  text(earthquakeName, 0, height - 30, width, 30);\n  noLoop();\n}\n\x3c/code\x3e\x3c/div\x3e"],
