itemtype:"method",name:"httpDo",return:{description:"A promise that resolves with the data when the operation\n                  completes successfully or rejects with the error after\n                  one occurs.",type:"Promise"},example:["\n\x3cdiv\x3e\n\x3ccode\x3e\n// Examples use USGS Earthquake API:\n// https://earthquake.usgs.gov/fdsnws/event/1/#methods\n\n// displays an animation of all USGS earthquakes\nlet earthquakes;\nlet eqFeatureIndex \x3d 0;\n\nfunction preload() {\n  let url \x3d 'https://earthquake.usgs.gov/fdsnws/event/1/query?format\x3dgeojson';\n  httpDo(\n    url,\n    {\n      method: 'GET',\n      // Other Request options, like special headers for apis\n      headers: { authorization: 'Bearer secretKey' }\n    },\n    function(res) {\n      earthquakes \x3d res;\n    }\n  );\n}\n\nfunction draw() {\n  // wait until the data is loaded\n  if (!earthquakes || !earthquakes.features[eqFeatureIndex]) {\n    return;\n  }\n  clear();\n\n  let feature \x3d earthquakes.features[eqFeatureIndex];\n  let mag \x3d feature.properties.mag;\n  let rad \x3d mag / 11 * ((width + height) / 2);\n  fill(255, 0, 0, 100);\n  ellipse(width / 2 + random(-2, 2), height / 2 + random(-2, 2), rad, rad);\n\n  if (eqFeatureIndex \x3e\x3d earthquakes.features.length) {\n    eqFeatureIndex \x3d 0;\n  } else {\n    eqFeatureIndex +\x3d 1;\n  }\n}\n\x3c/code\x3e\n\x3c/div\x3e"],
