itemtype:"method",name:"addRow",params:[{name:"row",description:"\x3cp\x3erow to be added to the table\x3c/p\x3e\n",type:"p5.TableRow",optional:!0}],return:{description:"the row that was added",type:"p5.TableRow"},example:["\n \x3cdiv class\x3d\"norender\"\x3e\n \x3ccode\x3e\n // Given the CSV file \"mammals.csv\"\n // in the project's \"assets\" folder:\n //\n // id,species,name\n // 0,Capra hircus,Goat\n // 1,Panthera pardus,Leopard\n // 2,Equus zebra,Zebra\n\n let table;\n\n function preload() {\n //my table is comma separated value \"csv\"\n //and has a header specifying the columns labels\n table \x3d loadTable('assets/mammals.csv', 'csv', 'header');\n }\n\n function setup() {\n //add a row\n let newRow \x3d table.addRow();\n newRow.setString('id', table.getRowCount() - 1);\n newRow.setString('species', 'Canis Lupus');\n newRow.setString('name', 'Wolf');\n\n //print the results\n for (let r \x3d 0; r \x3c table.getRowCount(); r++)\n   for (let c \x3d 0; c \x3c table.getColumnCount(); c++)\n     print(table.getString(r, c));\n }\n \x3c/code\x3e\n \x3c/div\x3e"],
