line:83,description:"\x3cp\x3eReturns a string representation of a vector v by calling String(v)\nor v.toString(). This method is useful for logging vectors in the\nconsole.\x3c/p\x3e\n",itemtype:"method",name:"toString",return:{description:"",type:"String"},example:['\n\x3cdiv class \x3d "norender"\x3e\n\x3ccode\x3e\nfunction setup() {\n  let v \x3d createVector(20, 30);\n  print(String(v)); // prints "p5.Vector Object : [20, 30, 0]"\n}\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\nfunction draw() {\n  background(240);\n\n  let v0 \x3d createVector(0, 0);\n  let v1 \x3d createVector(mouseX, mouseY);\n  drawArrow(v0, v1, \'black\');\n\n  noStroke();\n  text(v1.toString(), 10, 25, 90, 75);\n}\n\n// draw an arrow for a vector at a given base position\nfunction drawArrow(base, vec, myColor) {\n  push();\n  stroke(myColor);\n  strokeWeight(3);\n  fill(myColor);\n  translate(base.x, base.y);\n  line(0, 0, vec.x, vec.y);\n  rotate(vec.heading());\n  let arrowSize \x3d 7;\n  translate(vec.mag() - arrowSize, 0);\n  triangle(0, arrowSize / 2, 0, -arrowSize / 2, arrowSize, 0);\n  pop();\n}\n\x3c/code\x3e\n\x3c/div\x3e'],
