itemtype:"method",name:"getCentroid",return:{description:"Spectral Centroid Frequency   Frequency of the spectral centroid in Hz.",type:"Number"},example:["\n\x3cdiv\x3e\x3ccode\x3e\n function setup(){\ncnv \x3d createCanvas(100,100);\ncnv.mousePressed(userStartAudio);\nsound \x3d new p5.AudioIn();\nsound.start();\nfft \x3d new p5.FFT();\nsound.connect(fft);\n}\n\nfunction draw() {\nif (getAudioContext().state !\x3d\x3d 'running') {\n  background(220);\n  text('tap here and enable mic to begin', 10, 20, width - 20);\n  return;\n}\nlet centroidplot \x3d 0.0;\nlet spectralCentroid \x3d 0;\n\nbackground(0);\nstroke(0,255,0);\nlet spectrum \x3d fft.analyze();\nfill(0,255,0); // spectrum is green\n\n//draw the spectrum\nfor (let i \x3d 0; i \x3c spectrum.length; i++){\n  let x \x3d map(log(i), 0, log(spectrum.length), 0, width);\n  let h \x3d map(spectrum[i], 0, 255, 0, height);\n  let rectangle_width \x3d (log(i+1)-log(i))*(width/log(spectrum.length));\n  rect(x, height, rectangle_width, -h )\n}\nlet nyquist \x3d 22050;\n\n// get the centroid\nspectralCentroid \x3d fft.getCentroid();\n\n// the mean_freq_index calculation is for the display.\nlet mean_freq_index \x3d spectralCentroid/(nyquist/spectrum.length);\n\ncentroidplot \x3d map(log(mean_freq_index), 0, log(spectrum.length), 0, width);\n\nstroke(255,0,0); // the line showing where the centroid is will be red\n\nrect(centroidplot, 0, width / spectrum.length, height)\nnoStroke();\nfill(255,255,255);  // text is white\ntext('centroid: ', 10, 20);\ntext(round(spectralCentroid)+' Hz', 10, 40);\n}\n \x3c/code\x3e\x3c/div\x3e"],
